import React, { useState } from "react"; 
const Copywrite=()=>{
    const year=new Date();
    const [words,setWord]=useState("")
    const clickbutton=(p)=>{
        const word="hello" 
       setWord(word)
       const gold=(p)=>{
        return (<p>hi some thing is written in here. {p.name}{p.age}</p>)  
    }
     return(
        <div>
     <p>"this version is Copyright &copy; {year.getFullYear()} "</p>
    <button onClick={clickbutton}>justClick</button><p>{words}</p>
    </div>)
}}
export default Copywrite
